tables.table_schema:
CREATE TABLE BiometricRecords (
    user_id INT PRIMARY KEY,
    fingerprint_data BYTEA,
    facial_data BYTEA,
    timestamp TIMESTAMP
);

CREATE TABLE UserAccessLogs (
    log_id INT PRIMARY KEY,
    user_id INT,
    verification_method VARCHAR(50),
    access_time TIMESTAMP
);

CREATE TABLE user_biometrics (
    user_id INT PRIMARY KEY,
    fingerprint_data BYTEA,
    face_data BYTEA,
    voice_data BYTEA
);

CREATE TABLE fingerprint_logs (
    log_id SERIAL PRIMARY KEY,
    user_id INT REFERENCES user_biometrics(user_id),
    timestamp TIMESTAMPTZ,
    verification_result BOOLEAN
);

CREATE TABLE face_recognition_logs (
    log_id SERIAL PRIMARY KEY,
    user_id INT REFERENCES user_biometrics(user_id),
    timestamp TIMESTAMPTZ,
    verification_result BOOLEAN
);

CREATE TABLE biometric_users (
    user_id INT PRIMARY KEY,
    username TEXT NOT NULL,
    fingerprint_template BYTEA NOT NULL,
    face_template BYTEA NOT NULL
);

CREATE TABLE fingerprint_logs (
    log_id INT PRIMARY KEY,
    user_id INT REFERENCES biometric_users(user_id),
    log_timestamp TIMESTAMP NOT NULL,
    fingerprint_scanned BYTEA NOT NULL
);

CREATE TABLE face_logs (
    log_id INT PRIMARY KEY,
    user_id INT REFERENCES biometric_users(user_id),
    log_timestamp TIMESTAMP NOT NULL,
    face_image BYTEA NOT NULL
);

CREATE TABLE access_logs (
    log_id INT PRIMARY KEY,
    user_id INT REFERENCES biometric_users(user_id),
    log_timestamp TIMESTAMP NOT NULL,
    access_type TEXT NOT NULL
);

CREATE TABLE user_permissions (
    user_id INT REFERENCES biometric_users(user_id),
    permission_level INT NOT NULL
);
